import React from "react"
import './item.css'
import { Link } from 'react-router-dom';

class Item extends React.Component{
  render() {
    return (
      <div className="menuitem">
        <Link className={this.props.cName} href={this.props.to}>
          <li>{this.props.name}</li>
        </Link>
      </div>
    )
  }
}
export default Item
